import React  from 'react';
function CallNow() {
   
    return(

        <div className="imageSlider">
        <div onClick={this.onClickHandler} className="sideImages"> 
         </div>

          <div className='display'>
          <img src={this.state.images[0]['img']} alt="" />
        </div>
       </div>
    );
    
}
export default CallNow;
